
const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
canvas.width = 800;
canvas.height = 450;

const image1 = new Image();
/* image1.src = "image1.jpg";  Diretorio da imagem usada e convertida para base64(convertor online) */
image1.src = "data:image/jpeg;base64,"; /* Diretorio da imagem usada */
image1.addEventListener('load', function(){ /* sem esse evento a imagem no aparece */
    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height); /* apos o evento de load, carregar a imagem */
    const scannedImage = ctx.getImageData(0,0, canvas.width, canvas.height);
    console.log(scannedImage);/* imprime no console o rgb de cada pixel */

    /* tornando a imagem em grayscale(https://en.wikipedia.org/wiki/Grayscale) */
    const scannedData = scannedImage.data;
    for(let i =  0; i < scannedData.length; i += 4){
        const total = scannedData[i] + scannedData[i+1] + scannedData[i+2];
        const averageColorValue = total/3;
        scannedData[i] = averageColorValue;   /*  vermelho   R*/ 
        scannedData[i+1] = averageColorValue; /*    verde    G*/
        scannedData[i+2] = averageColorValue; /*     azul    B*/
    }
    scannedImage.data = scannedData;
    ctx.putImageData(scannedImage,0,0);
})

    function myColor(){
        var red = document.getElementById('red').value;
        var green = document.getElementById('green').value;
        var blue = document.getElementById('blue').value;
        var color = 'rgb('+ red + ',' + green + ',' + blue + ')';
        document.body.style.backgroundColor = color; /*Muda cor do background de acordo com o rgb*/
        document.getElementById('box').value = color;
    }
    
    document.getElementById('red').addEventListener('input', myColor);
    document.getElementById('green').addEventListener('input', myColor);
    document.getElementById('blue').addEventListener('input', myColor);

    /*segundo canvas */

    const myImage = new Image();
    myImage.src = 'data:image/jpeg;base64,'; /*image convertida para base64*/
    myImage.addEventListener('load', function(){
        const canvas2 = document.getElementById('canvas2');/* Define o Id canvas2 para a constante canvas2(ja tem canvas1).*/
        const ctx2 = canvas2.getContext('2d');
        canvas2.width = 718;
        canvas2.height = 898;
        ctx2.drawImage(myImage, 0, 0, canvas2.width, canvas2.height); /* desenha a imagem designada, bem na esquerda (0) e bem no top(0), definindo a largura igual do canvas  e definindo a altura igual do canvas*/

        let particlesArray = []; /* inicia um grupo para as particulas que seram criadas e redirecionada para esse grupo */
        const numberofParticles = 5000;/* define um valor maximo de particulas na imagem, talvez seja interessante aumentar a quantidade dependendo do tamanho da imagem usada */
        
        class Particle{ /* aqui define as caracteristicas das particulas, sua velocidade, tamanho, cor, define at onde ela pode ir(tamanho do canvas).*/
            constructor(){ /* Math random da uma valor aleatorio entre 0 e 1, assim as particulas tero velocidades e tamanho diferentes.*/
                this.x = Math.random() * canvas2.width;
                this.y = 0;
                this.speed = 0;
                this.velocity = Math.random() * 3.5;
                this.size = Math.random() * 1.5 + 1;
            }
            update(){ /* atualiza as caracteristicas das partculas */
                this.y += this.velocity;
                if(this.y >= canvas2.height){
                    this.y = 0;
                    this.x = Math.random() * canvas2.width;
                }
            }
            draw(){/* caracteristica de aparncia das partculas */
                ctx2.beginPath();
                ctx2.fillStyle = 'white';
                ctx2.arc(this.x, this.y, this.size, 0 , Math.PI * 2);/* deixa as partculas circulares */
                ctx2.fill();
            }
        }
        function init(){/* Inicia a gerao de partculas */
            for(let i = 0; i < numberofParticles; i++){
                particlesArray.push(new Particle);/* adiciona a partcula gerada pelo construtor no array.*/
            }
        }
        init();
        function animate(){/* Inicia a animao das partculas */
            ctx2.drawImage(myImage, 0, 0, canvas2.width, canvas2.height);
            ctx2.globalAlpha = 0.05;/* define uma opacidade */
            ctx2.fillStyle = 'rgb(0, 0, 0)';
            ctx2.fillRect(0, 0, canvas2.width, canvas2.height);
            for(let i = 0; i < particlesArray.length; i++){/* Para cada partcula no array, atualiza e desenha na imagem */
                particlesArray[i].update();
                particlesArray[i].draw();
            }
            requestAnimationFrame(animate);
        }
        animate();
    });

    /*terceiro canvas*/

    const myNewImage = new Image();
    myNewImage.src = 'data:image/jpeg;base64,'; 
    myNewImage.addEventListener('load', function(){
        const canvas3 = document.getElementById('canvas3');/* Define o Id canvas2 para a constante canvas2(ja tem canvas1).*/
        const ctx3 = canvas3.getContext('2d');
        canvas3.width = 626;
        canvas3.height = 626;

        ctx3.drawImage(myNewImage, 0, 0, canvas3.width, canvas3.height); /* desenha a imagem designada, bem na esquerda (0) e bem no top(0), definindo a largura igual do canvas  e definindo a altura igual do canvas*/
        const pixels = ctx3.getImageData(0, 0, canvas3.width, canvas3.height);

        let particlesArray = []; /* inicia um grupo para as particulas que seram criadas e redirecionada para esse grupo */
        const numberofParticles = 5000;/* define um valor maximo de particulas na imagem, talvez seja interessante aumentar a quantidade dependendo do tamanho da imagem usada */

        let mappedImage = [];
        for(let y = 0; y < canvas3.height; y++){
            let row = [];/*row igual height, no caso precisa de rows equivalente ao height da imagem.*/
            for (let x = 0; x < canvas3.width; x++){
                const red2 = pixels.data[(y * 4 * pixels.width) + (x * 4)];
                const green2 = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
                const blue2 = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
                const brightness = calculateRelativeBrightness(red2, green2, blue2);
                const cell = [
                    cellBrightess = brightness,
                ];
                row.push(cell);
            }
            mappedImage.push(row);
        }

        console.log(mappedImage);

        function calculateRelativeBrightness(red2, green2, blue2){
            return Math.sqrt(
                (red2 * red2) * 0.299 +
                (green2 * green2) * 0.587 +
                (blue2 * blue2) * 0.114
            )/100;
        }

        class Particle{ /* aqui define as caracteristicas das particulas, sua velocidade, tamanho, cor, define at onde ela pode ir(tamanho do canvas).*/
            constructor(){ /* Math random da uma valor aleatorio entre 0 e 1, assim as particulas tero velocidades e tamanho diferentes.*/
                this.x = Math.random() * canvas3.width;
                this.y = 0;
                this.speed = 0;
                this.velocity = Math.random() * 0.5;
                this.size = Math.random() * 1.5 + 1;
                this.position1 = Math.floor(this.y);
                this.position2 = Math.floor(this.x);
            }
            update(){ /* atualiza as caracteristicas das partculas */
                this.position1 = Math.floor(this.y);
                this.position2 = Math.floor(this.x);
                this.speed = mappedImage[this.position1][this.position2][0];
                let movement = (2.5 - this.speed) + this.velocity; 

                this.y += movement;
                if(this.y >= canvas3.height){
                    this.y = 0;
                    this.x = Math.random() * canvas3.width;
                }
            }
            draw(){/* caracteristica de aparncia das partculas */
                ctx3.beginPath();
                ctx3.fillStyle = 'white';
                ctx3.arc(this.x, this.y, this.size, 0 , Math.PI * 2);/* deixa as partculas circulares */
                ctx3.fill();
            }
        }
        function init(){/* Inicia a gerao de partculas */
            for(let i = 0; i < numberofParticles; i++){
                particlesArray.push(new Particle);/* adiciona a partcula gerada pelo construtor no array.*/
            }
        }
        init();
        function animate(){/* Inicia a animao das partculas */
            ctx3.globalAlpha = 0.05;/* define uma opacidade */
            ctx3.fillStyle = 'rgb(0, 0, 0)';
            ctx3.fillRect(0, 0, canvas3.width, canvas3.height);
            ctx3.globalAlpha = 0.2;
            for(let i = 0; i < particlesArray.length; i++){/* Para cada partcula no array, atualiza e desenha na imagem */
                particlesArray[i].update();
                ctx3.globalAlpha = particlesArray[i].speed;
                particlesArray[i].draw();
            }
            requestAnimationFrame(animate);
        }
        animate();
    });

    /*quarto canvas*/

    const canvas4 = document.getElementById('canvas4');
    const ctx4 = canvas4.getContext('2d');
    canvas4.width = window.innerWidth;
    canvas4.height = window.innerHeight;
    let particleArrayText = [];

    //mouse
    const mouse = {
        x: null,
        y: null,
        radius: 250
    }

    window.addEventListener('mousemove', function(event){
        mouse.x = event.x;
        mouse.y = event.y;
        //console.log(mouse.x, mouse.y);
    })

    ctx4.fillStyle = 'white';
    ctx4.font = '30px Verdana';
    ctx4.fillText('ShuuWolf', 60, 30);//o texto escrito no canvas!.
    ctx4.fillStyle2 = 'white';
    ctx4.font = '30px Verdana';
    ctx4.fillText('NeverWinter', 35, 90);//o texto escrito no canvas!.
    const textCoordinates = ctx4.getImageData(0, 0, 300, 300);//refere-se ao tamanho limite dentro do canvas, deixar pouco, acaba cortando o texto.

    class ParticleText{
        constructor(x, y){
            this.x = x;
            this.y = y;
            this.size = 3;
            this.baseX = this.x;
            this.baseY = this.y;
            this.density = (Math.random() * 40) + 5;
        }
        draw(){
            ctx4.fillStyle = "red";//cor do texto
            ctx4.beginPath();
            ctx4.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx4.closePath();
            ctx4.fill();
        }
        update(){
            let dx = mouse.x - this.x + 15;//coloquei esse valor a mais, para ficar centralizado no ponteiro do mouse
            let dy = mouse.y - this.y - 120;//coloquei esse valor a menos, para ficar centralizado no ponteiro do mouse
            let distance = Math.sqrt(dx * dx + dy * dy);
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;
            let maxDistance = mouse.radius;
            let force = (maxDistance - distance) / maxDistance;
            let directionX = forceDirectionX * force * this.density;
            let directionY = forceDirectionY * force * this.density;
            if(distance < mouse.radius){
                this.x -= directionX;
                this.y -= directionY;
            }else{
                if(this.x !== this.baseX){
                    let dx = this.x - this.baseX;
                    this.x -= dx/10;
                }
                if(this.y !== this.baseY){
                    let dy = this.y - this.baseY;
                    this.y -= dy/10;
                }
            }
        }
    }

function initText(){
    particleArrayText = [];
    for (let y = 0, y2 = textCoordinates.height; y < y2; y++){
        for (let x = 0, x2 = textCoordinates.width; x < x2; x++){
            if(textCoordinates.data[(y * 4 * textCoordinates.width) + (x * 4) + 3] > 128){ // pula os 3 primeiros valores, e pega o 4 valor referente a opacidade(rgb"a").
                let positionX = x;
                let positionY = y;
                particleArrayText.push(new ParticleText(positionX * 10, positionY * 10));
            }
        }
    }
}

initText();
console.log(particleArrayText);

function animateText(){
    ctx4.clearRect(0, 0, canvas4.width, canvas4.height);
    for(let i = 0; i < particleArrayText.length; i++){
        particleArrayText[i].draw();
        particleArrayText[i].update();
    }
    requestAnimationFrame(animateText);
}
animateText();
